/*Table structure for table `material_bill_allot` */

DROP TABLE IF EXISTS `material_bill_allot`;

CREATE TABLE `material_bill_allot` (
  `id` char(32) NOT NULL DEFAULT '',
  `material_setting_version_id` char(32) DEFAULT NULL COMMENT '单据设置id',
  `ref` varchar(20) DEFAULT NULL COMMENT '单号',
  `name` varchar(30) DEFAULT NULL COMMENT '单据名称',
  `type` varchar(10) DEFAULT NULL COMMENT '单据类型',
  `type_name` varchar(10) DEFAULT NULL,
  `description` varchar(100) DEFAULT NULL COMMENT '单据描述',
  `create_user` char(32) DEFAULT NULL COMMENT '创建人',
  `create_user_name` varchar(20) DEFAULT NULL COMMENT '创建人姓名',
  `dept` char(32) DEFAULT NULL COMMENT '部门',
  `dept_name` varchar(30) DEFAULT NULL COMMENT '部门名称',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `date` date DEFAULT NULL COMMENT '日期',
  `status` smallint(6) DEFAULT NULL COMMENT '单据状态',
  `is_recoiled` tinyint(1) DEFAULT NULL COMMENT '是否已反冲',
  `product_order` varchar(20) DEFAULT NULL COMMENT '生成订单',
  `sale_order` varchar(20) DEFAULT NULL COMMENT '销售订单',
  `ext_field` varchar(50) DEFAULT NULL,
  `ext_field2` varchar(50) DEFAULT NULL,
  `ext_field3` varchar(50) DEFAULT NULL,
  `remarks` varchar(255) DEFAULT NULL,
  `process_id` varchar(64) DEFAULT NULL COMMENT '流程id',
  `update_user` char(32) DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL,
  `del_flag` tinyint(2) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `material_bill_allot` */

