/*Table structure for table `material_bill_item_allot` */

DROP TABLE IF EXISTS `material_bill_item_allot`;

CREATE TABLE `material_bill_item_allot` (
  `id` char(32) NOT NULL DEFAULT '',
  `material_bill_id` char(32) DEFAULT NULL COMMENT '单据id',
  `line_number` smallint(10) DEFAULT NULL,
  `material_code` char(32) DEFAULT NULL COMMENT '物料编码',
  `material_name` varchar(150) DEFAULT NULL COMMENT '物料名称',
  `material_model` varchar(50) DEFAULT NULL COMMENT '物料型号',
  `material_specification` varchar(100) DEFAULT NULL COMMENT '物料规格',
  `material_unit` varchar(10) DEFAULT NULL COMMENT '物料单位',
  `material_unit_name` varchar(30) DEFAULT NULL,
  `material_description` varchar(100) DEFAULT NULL,
  `storehouse` varchar(32) DEFAULT NULL COMMENT '仓库',
  `storehouse_name` varchar(50) DEFAULT NULL,
  `storehouse_sys` varchar(50) DEFAULT NULL COMMENT '仓库所属系统',
  `area` varchar(32) DEFAULT NULL COMMENT '区域',
  `area_name` varchar(50) DEFAULT NULL,
  `location` varchar(32) DEFAULT NULL COMMENT '库位',
  `location_name` varchar(50) DEFAULT NULL,
  `in_storehouse` varchar(32) DEFAULT NULL COMMENT '调入仓库',
  `in_storehouse_name` varchar(50) DEFAULT NULL,
  `in_storehouse_sys` varchar(50) DEFAULT NULL COMMENT '调入仓库所属系统',
  `in_area` varchar(32) DEFAULT NULL COMMENT '调入区域',
  `in_area_name` varchar(50) DEFAULT NULL,
  `in_location` varchar(32) DEFAULT NULL COMMENT '调入库位',
  `in_location_name` varchar(50) DEFAULT NULL,
  `out_storehouse` varchar(32) DEFAULT NULL COMMENT '调出仓库',
  `out_storehouse_name` varchar(50) DEFAULT NULL,
  `out_storehouse_sys` varchar(50) DEFAULT NULL COMMENT '调出仓库所属系统',
  `out_area` varchar(32) DEFAULT NULL COMMENT '调出区域',
  `out_area_name` varchar(50) DEFAULT NULL,
  `out_location` varchar(32) DEFAULT NULL COMMENT '调出库位',
  `out_location_name` varchar(50) DEFAULT NULL,
  `batch_number` varchar(20) DEFAULT NULL COMMENT '批号',
  `serial_number` varchar(20) DEFAULT NULL COMMENT '序列号',
  `shaft_number` varchar(10) DEFAULT NULL COMMENT '轴号',
  `rank` varchar(10) DEFAULT NULL COMMENT '等级',
  `rank_name` varchar(10) DEFAULT NULL COMMENT '等级',
  `apply_amount` decimal(10,4) DEFAULT NULL COMMENT '申请数量',
  `actual_amount` decimal(10,4) DEFAULT NULL COMMENT '实际数量',
  `suggest_amount` decimal(10,4) DEFAULT NULL COMMENT '建议数量',
  `book_amount` decimal(10,4) DEFAULT NULL COMMENT '账面数量',
  `inventory_amount` decimal(10,4) DEFAULT NULL COMMENT '实盘数量',
  `different_amount` decimal(10,4) DEFAULT NULL COMMENT '差异数量',
  `product_order` varchar(20) DEFAULT NULL COMMENT '生产订单号',
  `ext_field` varchar(50) DEFAULT NULL,
  `ext_field2` varchar(50) DEFAULT NULL,
  `ext_field3` varchar(50) DEFAULT NULL,
  `remarks` varchar(100) DEFAULT '' COMMENT '备注',
  `create_user` char(32) DEFAULT NULL,
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `update_user` char(32) DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL,
  `del_flag` tinyint(2) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

