/*Table structure for table `material_inventory_record` */

DROP TABLE IF EXISTS `material_inventory_record`;

CREATE TABLE `material_inventory_record` (
  `id` char(32) NOT NULL,
  `material_bill_id` char(32) DEFAULT NULL COMMENT '单据id',
  `ref` varchar(20) DEFAULT NULL COMMENT '单号',
  `type` varchar(20) DEFAULT NULL COMMENT '单据类型',
  `type_name` varchar(30) DEFAULT NULL,
  `name` varchar(30) DEFAULT NULL COMMENT '单据名称',
  `date` date DEFAULT NULL COMMENT '单据日期',
  `material_code` char(50) DEFAULT NULL COMMENT '物料编码',
  `material_name` varchar(150) DEFAULT NULL COMMENT '物料名称',
  `material_unit` varchar(10) DEFAULT NULL COMMENT '物料单位',
  `material_unit_name` varchar(10) DEFAULT NULL,
  `storehouse_sys` varchar(50) DEFAULT NULL COMMENT '仓库所属系统',
  `storehouse` varchar(10) DEFAULT NULL COMMENT '仓库',
  `storehouse_name` varchar(50) DEFAULT NULL,
  `area` varchar(32) DEFAULT NULL COMMENT '区域',
  `area_name` varchar(50) DEFAULT NULL,
  `location` varchar(32) DEFAULT NULL COMMENT '库位',
  `location_name` varchar(50) DEFAULT NULL,
  `batch_number` varchar(20) DEFAULT NULL COMMENT '批号',
  `serial_number` varchar(20) DEFAULT NULL COMMENT '序列号',
  `shaft_number` varchar(20) DEFAULT NULL,
  `rank` varchar(10) DEFAULT NULL COMMENT '等级',
  `rank_name` varchar(10) DEFAULT NULL COMMENT '等级',
  `inventory_storehouse` varchar(10) DEFAULT NULL,
  `inventory_storehouse_name` varchar(50) DEFAULT NULL,
  `inventory_area` varchar(32) DEFAULT NULL,
  `inventory_area_name` varchar(50) DEFAULT NULL,
  `inventory_location` varchar(32) DEFAULT NULL,
  `inventory_location_name` varchar(50) DEFAULT NULL,
  `inventory_batch_number` varchar(20) DEFAULT NULL,
  `inventory_serial_number` varchar(20) DEFAULT NULL,
  `product_order` varchar(20) DEFAULT NULL COMMENT '生产订单',
  `sale_order` varchar(20) DEFAULT NULL COMMENT '销售订单',
  `in_status` tinyint(2) DEFAULT NULL COMMENT '入库状态（1已过账）',
  `out_status` tinyint(2) DEFAULT NULL COMMENT '出库状态（1已过账）',
  `amount` decimal(14,4) DEFAULT NULL COMMENT '数量',
  `inventory_amount` decimal(14,4) DEFAULT NULL COMMENT '结存数量',
  `record_date` date DEFAULT NULL COMMENT '库存记录日期',
  `tube_color` varchar(32) DEFAULT NULL COMMENT '管头颜色',
  `manufacturer` varchar(128) DEFAULT NULL COMMENT '生产厂家',
  `receipt_date` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '原料入库时间',
  `recoil_bill_id` char(32) DEFAULT NULL COMMENT '反冲单据id',
  `remarks` varchar(255) DEFAULT NULL,
  `create_user` char(32) DEFAULT NULL COMMENT '单据创建人',
  `create_time` timestamp(3) NULL DEFAULT NULL COMMENT '创建时间',
  `update_user` char(32) DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL,
  `del_flag` tinyint(2) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

