/*Table structure for table `material_inventory_record_info` */

DROP TABLE IF EXISTS `material_inventory_record_info`;

CREATE TABLE `material_inventory_record_info` (
  `id` char(32) NOT NULL,
  `material_inventory_record_id` char(32) DEFAULT NULL COMMENT '单据id',
  `subpena_number` varchar(20) DEFAULT NULL COMMENT '单号',
  `number` smallint(10) DEFAULT NULL COMMENT '单据类型',
  `positive_or_negative` varchar(2) DEFAULT NULL COMMENT '正反轴(1正轴，0反轴)',
  `remarks` varchar(255) DEFAULT NULL,
  `create_user` char(32) DEFAULT NULL COMMENT '单据创建人',
  `create_time` timestamp(3) NULL DEFAULT NULL COMMENT '创建时间',
  `update_user` char(32) DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL,
  `del_flag` tinyint(2) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `material_inventory_record_info` */

/*Table structure for table `material_setting` */

DROP TABLE IF EXISTS `material_setting`;

CREATE TABLE `material_setting` (
  `id` char(32) NOT NULL,
  `number` tinyint(2) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '编号',
  `name` varchar(30) DEFAULT NULL COMMENT '单据名称',
  `type` varchar(20) DEFAULT NULL COMMENT '单据类型',
  `type_name` varchar(30) DEFAULT NULL,
  `description` varchar(100) DEFAULT NULL COMMENT '单据描述',
  `is_audit` tinyint(1) DEFAULT NULL COMMENT '是否审核',
  `workflow_key` varchar(20) DEFAULT NULL COMMENT '审核工作流',
  `workflow_name` varchar(50) DEFAULT NULL,
  `encoding_rule` varchar(10) DEFAULT NULL COMMENT '编码规则',
  `status` varchar(10) DEFAULT NULL COMMENT '单据设置状态',
  `is_invoked` tinyint(1) DEFAULT '0',
  `create_user` char(32) DEFAULT NULL COMMENT '创建人',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_user` char(32) DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL,
  `del_flag` tinyint(2) DEFAULT '0',
  `remarks` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `number` (`number`) USING BTREE
